import logo from './logo.svg';
import './App.css';
import React, {useState, useEffect} from "react";
import axios from "axios";


const UserProfiles = () => {
  const fetchUserProfiles = () => {
    axios.get("localhost:8080/users/").then(res => {
      console.log(res);
    });
  };

  useEffect(() => {
    fetchUserProfiles();

  }, []);

  return  <h1>HELLO</h1>
};


function App() {
  return <div className="App">
    <UserProfiles />
  </div>
}

export default App;
